import {useEffect, useState} from "react";
import TutorialComponent from "./TutorialComponent";
import TutorialService from "../service/TutorialService";
function TutorialListComponent(){

    const [tutorials, setTutorials] = useState([]);
    const [inputValue, setInputValue] = useState('');
    const [isFormVisible, setIsFormVisible] = useState(true);
    const [isEdited, setIsEdited] = useState(false);
    const [currentTutorial, setCurrentTutorial] = useState(null);
    const [hoveredTutorial, setHoveredTutorial] = useState(null);
    async function fetchData(){
        const url = "http://localhost:8080/api/tutorials";
        try{
            const response = await fetch(url);
            if (!response.ok){
                console.error("Could not fetch resources");
            }
            const data = await response.json();
            setTutorials(data);
        }catch (error){
            console.log(error);
        }
    }

    function handleInputSearchChange(event){
        setInputValue(event.target.value);
    }

    async function handleSearchInput(title) {
        try {
            const data = await TutorialService.findByTitle(title);
            setTutorials(data);

        } catch (error) {
            console.log(error);
        }
    }

    function handleEditClick(){
        setIsFormVisible(false);
        setIsEdited(true);
        //tutorial={currentTutorial}
        // setCurrentTutorial(tutorial);
    }

    useEffect(() => {
        fetchData();
    }, []);


    return(
        <>
            {isFormVisible ? (
                <div className="wrapper">
                    <div className="search-bar md-3" style={{display: "flex", marginTop: "8px"}}>
                        <input id="searchInput" type="text" className="form-control"
                               aria-label="Dollar amount (with dot and two decimal places)"
                               placeholder="Search by title..."
                               value={inputValue} onChange={handleInputSearchChange}/>
                        <button id="searchButton" type="button" className="btn btn-primary" style={{marginLeft: "10px"}}
                        onClick={() => handleSearchInput(inputValue)}>Search
                        </button>
                    </div>
                    <div style={{marginTop: "30px"}} className="content">
                        <div className="mainContent">
                            <h2>Tutorials List</h2>
                            <table className="table table-hover">
                                <thead>
                                <tr>
                                    <th></th>
                                    <th>Title</th>
                                    <th>Description</th>
                                </tr>
                                </thead>
                                <tbody>
                                {
                                    tutorials.map(tutorial => (
                                        <tr key={tutorial.id}
                                            onMouseEnter={() => setHoveredTutorial(tutorial)}
                                        >
                                            <th scope="row"></th>
                                            <td>{tutorial.title}</td>
                                            <td>{tutorial.description}</td>
                                        </tr>))
                                }
                                </tbody>
                            </table>
                            <button type="button" className="btn btn-danger">Remove All</button>
                        </div>
                        <div className="contentDetail">
                            <h2>Tutorial</h2>
                            {hoveredTutorial && (
                                <><h6>Title: <span>{hoveredTutorial.title}</span></h6>
                                    <h6>Description: <span>{hoveredTutorial.description}</span></h6>
                                    <h6>Status: <span>Pending</span></h6>
                                </>
                            )}
                                <>
                                    <button type="button" className="btn btn-warning"
                                            style={{fontWeight: "600", width: "80px"}}
                                    >Edit
                                    </button>
                                </>

                        </div>
                    </div>
                </div>
            ) : (
                <>
                    <TutorialComponent />
                </>
            )
            }

        </>
    )

}

export default TutorialListComponent;
